import React from 'react';
import './App.css';
import './Layout.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const Layout = ({ children }) => {
  return (
    <div className="app-layout">
      {children}
    </div>
  );
}

export default Layout;
